searchNodes=[{"doc":"This module provides functions for parsing Russian Wiktionary entries given the dictionary form of a word. Currently, only parsing of verbs and nouns is supported.","ref":"WiktionaryParser.html","title":"WiktionaryParser","type":"behaviour"},{"doc":"Parses the Wiktionary entry for a word of a particular part of speech given its dictionary form. Returns {:ok, struct} if successful, {:error, reason} otherwise.","ref":"WiktionaryParser.html#c:parse/1","title":"WiktionaryParser.parse/1","type":"callback"},{"doc":"Parses the Wiktionary entry for a word as the appropriate struct given its dictionary form and the part of speech. The provided part_of_speech atom must be either :verb or :noun . Returns {:ok, struct} if successful, {:error, reason} otherwise. Examples iex&gt; WiktionaryParser . parse ( &quot;смотреть&quot; , :verb ) { :ok , % WiktionaryParser.Verb { translation : &quot;to look&quot; , infinitive : &quot;смотре́ть&quot; , ... } } iex&gt; WiktionaryParser . parse ( &quot;кот&quot; , :noun ) { :ok , % WiktionaryParser.Noun { translation : &quot;tomcat&quot; , gender : :masculine , ... } }","ref":"WiktionaryParser.html#parse/2","title":"WiktionaryParser.parse/2","type":"function"},{"doc":"Parses the Wiktionary entry for a word as the appropriate struct given its dictionary form and the part of speech. The provided part_of_speech atom must be either :verb or :noun . Returns the parsed struct if successful, or raises an error otherwise. Examples iex&gt; WiktionaryParser . parse! ( &quot;смотреть&quot; , :verb ) % WiktionaryParser.Verb { translation : &quot;to look&quot; , infinitive : &quot;смотре́ть&quot; , ... } iex&gt; WiktionaryParser . parse! ( &quot;кот&quot; , :noun ) % WiktionaryParser.Noun { translation : &quot;tomcat&quot; , gender : :masculine , ... }","ref":"WiktionaryParser.html#parse!/2","title":"WiktionaryParser.parse!/2","type":"function"},{"doc":"A struct representing a Russian noun.","ref":"WiktionaryParser.Noun.html","title":"WiktionaryParser.Noun","type":"module"},{"doc":"A Russian noun. Fields :translation : The English translation of the noun. :translation : The grammatical gender of the noun. :nominative_singular : The nominative singular form of the noun. :genitive_singular : The genitive singular form of the noun. :dative_singular : The dative singular form of the noun. :accusative_singular : The accusative singular form of the noun. :instrumental_singular : The instrumental singular form of the noun. :prepositional_singular : The prepositional singular form of the noun. :nominative_plural : The nominative plural form of the noun. :genitive_plural : The genitive plural form of the noun. :dative_plural : The dative plural form of the noun. :accusative_plural : The accusative plural form of the noun. :instrumental_plural : The instrumental plural form of the noun. :prepositional_plural : The prepositional plural form of the noun. :partitive_singular : The partitive singular form of the noun. :partitive_plural : The partitive plural form of the noun. :vocative_singular : The vocative singular form of the noun. :vocative_plural : The vocative plural form of the noun.","ref":"WiktionaryParser.Noun.html#t:t/0","title":"WiktionaryParser.Noun.t/0","type":"type"},{"doc":"Implements the WiktionaryParser behaviour to parse Wiktionary entries for Russian nouns.","ref":"WiktionaryParser.NounParser.html","title":"WiktionaryParser.NounParser","type":"module"},{"doc":"","ref":"WiktionaryParser.NounParser.html#extract_gender/1","title":"WiktionaryParser.NounParser.extract_gender/1","type":"function"},{"doc":"Parses the Wiktionary entry for a noun, given its nominative singular form. Returns {:ok, noun} if successful, {:error, reason} otherwise.","ref":"WiktionaryParser.NounParser.html#parse/1","title":"WiktionaryParser.NounParser.parse/1","type":"function"},{"doc":"A struct representing a Russian verb.","ref":"WiktionaryParser.Verb.html","title":"WiktionaryParser.Verb","type":"module"},{"doc":"A Russian verb. Fields :translation : The English translation of the verb. :infinitive : The infinitive form of the verb. :aspect : The aspect of the verb. :present_first_singular : The first-person singular form in the present tense. :present_second_singular : The second-person singular form in the present tense. :present_third_singular : The third-person singular form in the present tense. :present_first_plural : The first-person plural form in the present tense. :present_second_plural : The second-person plural form in the present tense. :present_third_plural : The third-person plural form in the present tense. :future_first_singular : The first-person singular form in the future tense. :future_second_singular : The second-person singular form in the future tense. :future_third_singular : The third-person singular form in the future tense. :future_second_plural : The second-person plural form in the future tense. :future_first_plural : The first-person plural form in the future tense. :future_third_plural : The third-person plural form in the future tense. :past_singular_masculine : The singular masculine form in the past tense. :past_singular_feminine : The singular feminine form in the past tense. :past_singular_neuter : The singular neuter form in the past tense. :past_plural : The plural form in the past tense. :imperative_second_singular : The second-person singular imperative form. :imperative_second_plural : The second-person plural imperative form. :present_active_participle : The present active participle form. :past_active_participle : The past active participle form. :present_passive_participle : The present passive participle form. :past_passive_participle : The past passive participle form. :present_adverbial_participle : The present adverbial participle form. :past_adverbial_participle : The past adverbial participle form.","ref":"WiktionaryParser.Verb.html#t:t/0","title":"WiktionaryParser.Verb.t/0","type":"type"},{"doc":"Implements the WiktionaryParser behaviour to parse Wiktionary entries for Russian verbs.","ref":"WiktionaryParser.VerbParser.html","title":"WiktionaryParser.VerbParser","type":"module"},{"doc":"Parses the Wiktionary entry for a verb, given its infintive form. Returns {:ok, verb} if successful, {:error, reason} otherwise.","ref":"WiktionaryParser.VerbParser.html#parse/1","title":"WiktionaryParser.VerbParser.parse/1","type":"function"}]